resource.description:
This datasets contains information about NYCHA residents’ use of:

a) <a href="https://www1.nyc.gov/site/dca/consumers/get-free-financial-counseling.page">NYC Financial Empowerment Centers</a>: a program that provides free, one-on-one professional financial counseling and coaching to all NYC residents. Each row in the dataset represents the number of NYCHA residents on a Borough-level who utilized this service;

b) <a href="https://www1.nyc.gov/site/dca/partners/EmpoweredNYC.page">EmpoweredNYC</a>: is an initiative to assist New Yorkers with disabilities and their families to better manage their finances and become more financially stable. Each row in the dataset represents the number of NYCHA residents on a Borough-level who utilized this service; 

c) <a href="https://www1.nyc.gov/site/dca/media/pr012618.page">Student Loan Debt clinic</a>: is an initiative to help New Yorkers understand their student loans and how to repay them. Each row in the dataset represents the number of NYCHA residents on a Borough-level who utilized this service; and 

d) <a href="https://www1.nyc.gov/site/hpd/renters/ready-to-rent.page">Ready to Rent</a>: a program providing free one-on-one financial counseling to New Yorkers seeking to apply for affordable housing units through HPD’s Housing Connect lottery. Each row in the dataset represents the number of NYCHA residents on a Borough-level who utilized this service.

The dataset is part of the annual report compiled by the Mayor’s Office of Operations as mandated by the <a href="https://legistar.council.nyc.gov/LegislationDetail.aspx?ID=2745761&GUID=2A9FB1D2-A1A8-4484-9D49-6F8332171B66">Local Law 163 of 2016</a> on different services provided to NYCHA residents. See other datasets in this report by searching the keyword “Services available to NYCHA Residents - Local Law 163 (2016)” on the Open Data Portal.

