• Finger Lakes (Genesee, Livingston, Monroe, Ontario, Orleans, Seneca, Wayne, Wyoming and Yates 
Counties);
• Hudson Valley (Dutchess, Orange, Putnam, Rockland, Sullivan, Ulster and Westchester Counties);
• Long Island (Nassau and Suffolk
Counties); Mohawk Valley (Fulton, Herkimer, Montgomery, Oneida, Otsego and Schoharie Counties);
• New York City (Bronx, Kings, New York, Queens and Richmond Counties);
• North Country (Clinton, Essex, Franklin,
Hamilton, Jefferson, Lewis and St. Lawrence Counties);
• Southern Tier (Broome, Chemung, Chenango, Delaware, Schuyler, Steuben, Tioga and Tompkins 
Counties); and
• Western New York (Allegany, Cattaraugus, Chautauqua, Erie and Niagara Counties).
